import React from 'react';
import {View, Text, Button} from 'react-native';
import {ListItem} from 'react-native-elements'

class ListScheduleDay extends React.Component {
  constructor (props) {
    super(props)
    this.state = {
      schedule:[
      {start:'9:00',end:'11:00',lesson:'The Duc'},
      {start:'13:00',end:'15:00',lesson:'Toan'},
      {start:'15:00',end:'17:00',lesson:'Van'},
    ],
    }}

  render() {
    return(
      <View>
      {this.state.schedule.map((item,i) => (
        <ListItem
          key={i}
          title={item.lesson}
          subtitle={item.start+" "+item.end}
          leftAvatar={{color: 'FF3456'}}
        />
      ))}
      </View>
    )}
}

export default ListScheduleDay;
